髪の化粧水（ノンシリコンタイプ）。ブローローション。
<br><br>デジパム3D AQUA advance(3Dアクアアドバンス)は、シリコン・アルコール・界面活性剤を一切使用せず、天然系成分にとことんこだわって作った「髪のための化粧水」です。<br><br>【デジパム3D AQUA advance(3Dアクアアドバンス)】<br>髪の化粧水（ノンシリコンタイプ）。ブローローション。<br><br>富山海洋深層水を使用し、<br>主成分のキトアクア、セラミドがキューティクルを整え、アロエエキス、コラーゲン、ヒアルロン酸が髪に水分を補います。<br>ツヤとなめらかさを与え指通りの良い、まとまりのある自然な髪に整えます。<br><br>・パーマやカラーリングで傷んだ髪に。<br>・枝毛やパサつきが気になる髪に。<br>・ドライヤーやカールアイロンの前に。<br>・頭皮が敏感肌の方に。<br>・ナチュラル志向の方に。<br><br>【使用方法】<br>シャンプー後、軽くタオルドライし、ダメージ部分を中心に適量をなじませ、その後乾かしてください。<br>本品はコート剤を含まないため、直後に変化はありませんが、乾かすほどにツルツルサラサラになり、効果を実感いただけます。<br><br>※ご使用上の注意をよく読んでお使いください。<br><br>【成分】<br>水、BG、グリセリン、カルボキシメチルキトサンサクシナミド（キトアクア）、海水（海洋深層水）、ヒアルロン酸Na、アロエベラ葉エキス、ユズ果実エキス（ユズセラミド）、水溶性コラーゲン、フェノキシエタノール、クエン酸、クエン酸Na<br><br>【メーカー】<br>U.corporation<br><br>【シリーズ】<br>デジパム<br><br>【商品区分】<br>化粧品<br><br>【広告文責】<br>美想心花(06-4309-7820)<br><br><img src="http://image.rakuten.co.jp/bisousinka/cabinet/ship1-3.jpg" width="100%" /><style type="text/css"> 
